import React from "react";

function Header (){
    return (
        <header>
            <nav className="flex justify-between items-center py-4 px-6 bg-white border-b-2 border-gray-200">
                <div className="flex items-center">
                    <a href="/">
                        <img src="https://tailwindui.com/img/logos/logo-lockup-solid.svg" alt="Logo" className="h-8 w-auto" />
                    </a>
                </div>
                <div className="flex items-center">
                    <a href="/login">Login</a>
                    <a href="/signup">Sign Up</a>
                </div>
            </nav>
        </header>
    );
}

export default Header;
